INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Certainty', '<def-root>A <fen>Cause</fen>, animate or inanimate, causes an <fen>Effect</fen>. Those frames that inherit the Causation frame convey the idea that some event is responsible for the occurrence', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Activity', '<def-root>Words in this frame have to do with a Cognizer believing that some Phenomenon will take place in the future. <ex><fex name="Cog">Michael</fex> <t>expected</t> <fex name="Phen">Abby</fex> <fex name="Phen">to demand examples</fex>.</ex>', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Activity_finish', '<def-root>This frame contains adjectives and nouns that describe the truth or sincerity of communication. These words, analogously to behaver-evaluating words, can apply either to <fen>Speaker</fen>s or to the <fen>Message</fen>s they produce.', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Activity_start', '<def-root>Words in this frame have to do with a <fen>Cognizer</fen> creating a new intellectual entity, the <fen>Invention</fen>. These words are similar to words of physical creation such as <ment>build</ment> and <ment>make</ment>, ', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Activity_stop', '<def-root>These words describe the size of message that a <fen>Speaker</fen> is judged by a (usually unexpressed) <fen>Judge</fen> to give, either in a specific occasion or <fen>Topic</fen> or in general. As in other communication frames', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Activity_resume', '<def-root>The words in this frame describe the "fictive" motion of a stationary Road. Some of the targets cast the scene primarily in terms of the Path_shape: ', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Activity_pause', '<def-root>These are words describing situations in which a <fen>Perpetrator</fen> takes something (<fen>Goods</fen>) from a <fen>Victim</fen> that does not belong to him . The robbery can be done in a particular <fen>Manner</fen> ', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Activity_prepare', '<def-root>An <fen>Emitter</fen> emits a <fen>Beam</fen> of light from a <fen>Source</fen>, along a <fen>Path</fen>, and/or towards a <fen>Goal</fen>.  Essentially, this frame denotes the (semi-)fictive motion of the the <fen>Beam</fen>. ', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Reporting', '<def-root>This frame is concerned with transparent nouns denoting a <fen>Piece</fen> of a <fen>Substance</fen>. Also present is <fen>Piece_prop</fen> which is a property of the <fen>Piece</fen>, e.g. relating to its size.<ex>Kim ate a <fex', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Statement', '<def-root>An <fen>Agent</fen> begins an <fen>Activity</fen> at a certain <fen>Place</fen> and <fen>Time</fen>.</def-root>', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Evidence', '<def-root>A <fen>Figure</fen> is located relative to a <fen>Ground</fen> location.  The location of the <fen>Figure</fen> may be further specified by its <fen>Distance</fen> from a reference location (generally, the deictic center) and the', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Judgement', '<def-root>A <fen>Protagonist</fen> is sensitive to a <fen>Trigger</fen>, which has the potential to cause some kind of reaction in the <fen>Protagonist</fen>. </def-root>', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Arriving', '<def-root>This frame contains words that necessarily indicate the motion of two distinct objects. The <fen>Theme</fen> is typically animate and is expressed the same way a Self-mover is expressed in the Self-motion frame', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Self_motion', '<def-root>In this frame a <fen>Speaker</fen> asks an <fen>Addressee</fen> for something, or to carry out some action.', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Request', 'This frame involves a <fen>Creator</fen> making an imitation or fake (the <fen>Copy</fen>) of some <fen>Original</fen> entity. ', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Statement', '<def-root>This frame contains verbs and nouns that communicate the act of a <fen>Speaker</fen> to address a <fen>Message</fen> to some <fen>Addressee</fen> using language. ', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Discussion', '<def-root>Two (or more) people (the <fen>Interlocutors</fen>, also encodable as <fen>Interlocutor_1</fen> and <fen>Interlocutor_2</fen>) talk to one another. No person is construed as only a speaker or only an addressee.', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Gesture', '<def-root>The words in this frame have to do with non-verbal communication. Topic is not normally expressed with these words. This seems to be related to the absence of a verbal code in cases of gestural communication. ', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Recovery', '<def-root>These words describe the recovery or healing of a <fen>Patient</fen> from an <fen>Affliction</fen> without reference to the influence of any Treatment or Healer (see the Cure frame). </def-root>', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Filling', '<def-root>These are words relating to filling containers and covering areas with some thing, things or substance, the <fen>Theme</fen>. The area or container can appear as the direct object with all these verbs, and ', 'test user');
INSERT INTO Frame (Name, Definition, CreatedBy) VALUES ('Placing', '<def-root>Generally without overall motion,  an <fen>Agent</fen> places a <fen>Theme</fen> at a location, the <fen>Goal</fen>, which is profiled.  In this frame, the <fen>Theme</fen> is under th', 'test user');
